    LX.PaydayForm.prototype.setDefaultNextPayday = function() {
        var nextPayDate;
        if (this.getField("pay_date1").getValue() === "") {
            nextPayDate = new Date();
            nextPayDate.setDate(nextPayDate.getDate() + 1);
            var daysToAdd = 0;
            if (nextPayDate.getDay() == 0) {
                daysToAdd = 5
            }
            if (nextPayDate.getDay() == 1) {
                daysToAdd = 4
            }
            if (nextPayDate.getDay() == 2) {
                daysToAdd = 3
            }
            if (nextPayDate.getDay() == 3) {
                daysToAdd = 2
            }
            if (nextPayDate.getDay() == 4) {
                daysToAdd = 1
            }
            if (nextPayDate.getDay() == 5) {
                daysToAdd = 7
            }
            if (nextPayDate.getDay() == 6) {
                daysToAdd = 6
            }
            nextPayDate.setDate(nextPayDate.getDate() + daysToAdd)
        } else {
            nextPayDate = $.datepicker.parseDate("yy-mm-dd", this.getField("pay_date1").getValue())
        }
        nextPayDate = this._getPaydayDates().findAvailableDate(nextPayDate, 1);
        this.getField("pay_date1").setValue($.datepicker.formatDate("yy-mm-dd", nextPayDate))
    };
    LX.PaydayForm.prototype._getPaydayDates = function() {
        throw 'You must overwrite "LX.PaydayForm.prototype._getPaydayDates"'
    };
