    LX.PaydayFormInit.prototype.init = function(config) {
        this.initLeadSession();
        this.initMessages(config.Messages);
        this.initHttp();
        var processingPage = this.initProcessingPage(config);
        config.Form = this.initFormConfig(config.Form, processingPage);
        if (typeof withoutEmbeddedForm == "undefined" || !withoutEmbeddedForm) {
            this.initForm(config.Form);
            this.initFormProgressbar(config.FormProgressbar)
        } else {
            var urlParameters = new LX.GetParameters(window.location);
            processingPage.setLeadId(urlParameters.get("leadId"));
            processingPage.pushRun();
            processingPage.show()
        }
    };
    LX.PaydayFormInit.prototype.initLeadSession = function() {
        if (typeof this._lg_form_.leadx !== "undefined") {
            document.cookie = this._lg_form_.leadxCookieName + "=" + encodeURIComponent(this._lg_form_.leadx) + "; max-age=" + 60 * 60 * 24 + "; path=/"
        }
    };
    LX.PaydayFormInit.prototype.initFormConfig = function(formConfig, processingPage) {
        formConfig.processingPage = processingPage;
        formConfig.additionalData.tag = "bablo";
        if (typeof this._lg_form_.testPartners !== "undefined") {
            formConfig.additionalData.test_partners = this._lg_form_.testPartners
        }
        if (document.cookie.length != 0) {
            var cookieValue = document.cookie.match(new RegExp("(^|;)[\\s]*" + this._lg_form_.leadxCookieName + "=([^;]*)"));
            if (cookieValue !== null) {
                formConfig.additionalData.leadx = decodeURIComponent(cookieValue[2])
            }
        }
        return formConfig
    };
    LX.PaydayFormInit.prototype.initForm = function(formConfig) {
        var form = this.initFormObject(formConfig),
            formValidation = this.initValidation(form, formConfig);
        this.initErrorFormFieldViews(form, formConfig, formValidation);
        this.initTooltipImages(form, formConfig);
        this.initAutocomplete(form, formConfig);
        this.initMultipartTextField(formConfig);
        this.initBackButtons(formConfig);
        this.finishPaydayFormInit(form, formConfig);
        this.prefillForm(form)
    };
    LX.PaydayFormInit.prototype.initValidation = function(form, formConfig) {
        var formValidation = new LX.FormValidation();
        formValidation.addRules(formConfig.validationRules);
        formValidation.addComplexRules(formConfig.complexValidationRules);
        form.setValidation(formValidation);
        return formValidation
    };
    LX.PaydayFormInit.prototype.initErrorFormFieldViews = function(form, formConfig, formValidation) {
        form.addFormFieldView(new formConfig.FormFieldViewValidity.Class(formConfig.FormFieldViewValidity.options), formValidation.getAllFieldNames());
        form.addFormFieldView(new formConfig.FormFieldViewTooltipErrorClass(), formValidation.getAllFieldNames())
    };
    LX.PaydayFormInit.prototype.initTooltipImages = function(form, formConfig) {
        var tooltipImagesConfig = formConfig.tooltipImages;
        $(".dev-element-tooltip-image").each(function(index, element) {
            var tooltipImageConfig = tooltipImagesConfig[$(element).data("field-name")];
            tooltipImageConfig.$element = $(element);
            tooltipImageConfig.formField = form.getField($(element).data("field-name"));
            form.addFormFieldView(new formConfig.FormFieldViewTooltipImageClass(tooltipImageConfig), [$(element).data("field-name")])
        })
    };
    LX.PaydayFormInit.prototype.initAutocomplete = function(form, formConfig) {
        var autocompleteRules = formConfig.autocompleteRules;
        var formAutocomplete = new LX.FormAutocomplete(form);
        formAutocomplete.addRules(autocompleteRules);
        var fieldsWithLoader = [];
        for (var i = 0; i < autocompleteRules.length; i++) {
            var rule = autocompleteRules[i];
            if (rule.type == "Server") {
                fieldsWithLoader = fieldsWithLoader.concat(rule.targetFields)
            }
            if (rule.type == "RemoteValidation") {
                fieldsWithLoader = fieldsWithLoader.concat(rule.sourceFields)
            }
        }
        form.addFormFieldView(new formConfig.FormFieldViewLoaderClass(), fieldsWithLoader);
        form.setAutocomplete(formAutocomplete);
        return formAutocomplete
    };
