    LX.PaydayFormInit.prototype.finishPaydayFormInit = function(form, formConfig) {
        form.setDefaultNextPayday();
        form.checkFieldsDefaultValues(form.getAllFieldNames());
        form.initComplete()
    };
    LX.PaydayFormInit.prototype.prefillForm = function(form) {
        var prefilledFormData = LX.PrefilledFormData || this._lg_form_.formData || {},
            getParameters = new LX.GetParameters(window.location),
            fieldNames = form.getAllFieldNames(),
            fieldName, fieldValue, i;
        for (i = 0; i < fieldNames.length; i++) {
            fieldValue = getParameters.get(fieldNames[i], null);
            if (fieldValue !== null && fieldValue !== "") {
                prefilledFormData[fieldNames[i]] = fieldValue
            }
        }
        for (fieldName in prefilledFormData) {
            if (!prefilledFormData.hasOwnProperty(fieldName)) {
                continue
            } else {
                prefilledFormData[fieldName] = this.correctValueIfNeeded(fieldName, prefilledFormData[fieldName])
            }
            var field = form.getField(fieldName);
            if (field._options && field._options.dependentField) {
                var dependentField = field._options.dependentField;
                if (!(dependentField instanceof LX.FormField)) {
                    throw new TypeError('Option "dependentField" must be instance of LX.FormField.')
                }
                if (!dependentField.getValue()) {
                    var value = prefilledFormData[dependentField._options.name] || dependentField._options.defaults[prefilledFormData[fieldName]];
                    dependentField.setValue(value)
                }
            }
            field.setValue(prefilledFormData[fieldName])
        }
    };
    LX.PaydayFormInit.prototype.correctValueIfNeeded = function(fieldName, value) {
        if (fieldName == "requested_amount") {
            if (value > 800) {
                return 1000
            } else {
                if (value >= 500) {
                    return 500
                } else {
                    return 400
                }
            }
        }
        return value
    };
